var global int
var globalList []string

func main() {
	list := os.Args[1]

	globalList = strings.Split(list, " ")

	global = 0
	// os.Setenv("SPANNER_EMULATOR_HOST", "localhost:9010")
	// os.Setenv("PROJECT_ID", "spanner-project")
	// os.Setenv("INSTANCE_NAME", "spanner-instance")
	// os.Setenv("DATABASE_NAME", "spanner-database")
	// os.Setenv("TABLE_NAME", "report")
	// os.Setenv("SPANNER_EMULATOR_HOST", "localhost:9010")
	fmt.Println("Start worker")
	url := "projects/" + os.Getenv("PROJECT_ID") + "/instances/" + os.Getenv("INSTANCE_NAME") + "/databases/" + os.Getenv("DATABASE_NAME")
	ctx := context.Background()
	client, err := spanner.NewClient(ctx, url)
	if err != nil {
		fmt.Println("Error occured ", err)
	}
	err = writeCompressedPDF(client, ctx)
	if err != nil {
		fmt.Println("Error occured ", err)
	}
	err = writeUncompressedPDF(client, ctx)
	if err != nil {
		fmt.Println("Error occured ", err)
	}
	err = writeTXT(client, ctx)
	if err != nil {
		fmt.Println("Error occured ", err)
	}
	client.Close()
	fmt.Println("Spanner seeding process complited")
}

