func writeTXT(client *spanner.Client, ctx context.Context) error {
	var err error
	for u := 0; u < 5; u++ {
		_, err = client.ReadWriteTransaction(ctx, func(ctx context.Context, txn *spanner.ReadWriteTransaction) error {
			stmts := []spanner.Statement{}
			for k := 0; k < 100; k++ {
				sql := generateSQL(0, 25, 10)
				if sql != "" {
					stmts = append(stmts, spanner.Statement{SQL: sql})
				}
			}
			rowCounts, err := txn.BatchUpdate(ctx, stmts)
			if err != nil {
				return err
			}
			fmt.Printf("Executed %d SQL statements using Batch DML. TXT \n", len(rowCounts)*10)
			return nil
		})
	}
	return err
}

func writeCompressedPDF(client *spanner.Client, ctx context.Context) error {
	var err error
	_, err = client.ReadWriteTransaction(ctx, func(ctx context.Context, txn *spanner.ReadWriteTransaction) error {
		stmts := []spanner.Statement{}
		for k := 0; k < 10; k++ {
			sql := generateSQL(26, 30, 1)
			if sql != "" {
				stmts = append(stmts, spanner.Statement{SQL: sql})
			}
		}
		rowCounts, err := txn.BatchUpdate(ctx, stmts)
		if err != nil {
			return err
		}
		fmt.Printf("Executed %d SQL statements using Batch DML. PDF compressed \n", len(rowCounts)*1)
		return nil
	})
	return err
}

func writeUncompressedPDF(client *spanner.Client, ctx context.Context) error {
	var err error
	_, err = client.ReadWriteTransaction(ctx, func(ctx context.Context, txn *spanner.ReadWriteTransaction) error {
		stmts := []spanner.Statement{}
		for k := 0; k < 10; k++ {
			sql := generateSQL(31, 31, 1)
			if sql != "" {
				stmts = append(stmts, spanner.Statement{SQL: sql})
			}
		}
		rowCounts, err := txn.BatchUpdate(ctx, stmts)
		if err != nil {
			return err
		}
		fmt.Printf("Executed %d SQL statements using Batch DML. PDF uncompressed \n", len(rowCounts)*1)
		return nil
	})
	return err
}
